import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img src='https://c7.hotpng.com/preview/251/282/421/arizona-coyotes-national-hockey-league-logo-ice-hockey-others.jpg'/>
        <nav>
          <div>
            Profile
          </div>
          <div>
            Massage
          </div>
        </nav>
        <div>
          My content
        </div>
      </header>
    </div>
  );
}

export default App;
